При исполнении договора допускаются следующие изменения условий по соглашению сторон: 
- снижение цены договора без изменений иных условий договора;
- увеличение или уменьшение предусмотренного договором объема работ не более чем на десять процентов с пропорциональным изменением цены договора;
- улучшение качественных, функциональных характеристик работ по сравнению с характеристиками, установленными договором.
